import styled from 'styled-components';

export const CardContainer = styled.div`
    width: 1100px;
    height: 500px;
    display: flex;
    border-radius: 26px;
    position: relative;
    justify-content: center;
    align-items: center;
    border: 2px solid #DA4264;
    background-color: rbga(255, 255, 255, 0.2);
    backdrop-filter: blur(10px);
`;
